                        "tag=$(git tag | tail -n 1)",
                        "tag=${tag#v}",
                        "if [ \"$tag\" != \"$appver\" ]; then",
                        "echo \"The most recent tag $tag does not match the application version $appver\\n\"",
                        "sed -i -E \"s/$appver/$tag/\" cghooks",
                        "exit 1",
